pragma solidity ^0.4.17;


import './interfaces/IContractProvider.sol';
import './interfaces/IAssetRegistry.sol';
import './interfaces/IEntityRegistry.sol';

import './ContractProviderEnabled.sol';
import './libraries/DoublyLinkedList.sol';


contract Endorsement is ContractProviderEnabled {
    using DoublyLinkedList for DoublyLinkedList.Elements;

    /**
     * Stores entity endorsements
     * @param bytes32 Entity to be endorsed
     * @param DoublyLinkedList.Elements Entities that endorse given entity
     */
    mapping(bytes32 => DoublyLinkedList.Elements) public entityEndorsements;

    /**
     * Stores asset endorsements
     * @param bytes32 Asset to be endorsed
     * @param DoublyLinkedList.Elements Entities that endorse given asset
     */
    mapping(bytes32 => DoublyLinkedList.Elements) public assetEndorsements;

    /**
     * Event emmited when entity endorse another entity
     */
    event LogEntityEndorsed(
        bytes32 indexed endorsedEntityId,
        bytes32 indexed endorserId,
        address sender
    );

    /**
     * Event emitted when entity endorsed an asset
     */
    event LogAssetEndorsed(
        bytes32 indexed endorsedAssetId,
        bytes32 indexed endorserId,
        address sender
    );

    /**
     * Event emitted when entity revokes its endorsement of another entity
     */
    event LogEntityRevokeEndorsement(
        bytes32 indexed endorsedEntityId,
        bytes32 indexed endorserId,
        address sender
    );

    /**
     * Event emitted when entity revokes its endorsement of an asset
     */
    event LogAssetRevokeEndorsement(
        bytes32 indexed endorsedAssetId,
        bytes32 indexed endorserId,
        address sender
    );

    /**
     * Allow only owner of delegate of given entity to run action
     * @param endorserId Entity id that sender represents
     */
    modifier onlyOwnerOrDelegate(bytes32 endorserId) {
        address entityRegistryAddress = IContractProvider(cp).contracts("entity_registry");
        address owner = IEntityRegistry(entityRegistryAddress).getOwner(endorserId);
        require(msg.sender == owner
            || IEntityRegistry(entityRegistryAddress).delegates(endorserId, msg.sender));
        _;
    }

    /**
     * Allow action only if entity exists
     * @param entityId Entity id that should be validated
     */
    modifier entityExists(bytes32 entityId) {
        address entityRegistryAddress = IContractProvider(cp).contracts("entity_registry");
        require(IEntityRegistry(entityRegistryAddress).confirmRegisteredEntity(entityId));
        _;
    }

    /**
     * Allow action only if asset exists
     * @param assetId Asset id that should be validated
     */
    modifier assetExists(bytes32 assetId) {
        address assetRegistryAddress = IContractProvider(cp).contracts("asset_registry");
        require(IAssetRegistry(assetRegistryAddress).doesAssetExist(assetId));
        _;
    }

    /**
     * Endorse entity by other entity. Simply says endorserId trusts entityId
     * @param  entityId Entity id to be endorsed
     * @param  endorserId Entity id that is endorsing
     * @return Success of operation
     */
    function endorseEntity(bytes32 entityId, bytes32 endorserId)
        public
        onlyOwnerOrDelegate(endorserId)
        entityExists(entityId)
        returns(bool)
    {
        LogEntityEndorsed(entityId, endorserId, msg.sender);
        return entityEndorsements[entityId].addElement(endorserId);
    }

    /**
     * Endorse asset by entity. Simply says endorserId trusts assetId
     * @param  assetId Asset id to be endorsed
     * @param  endorserId Entity id that is endorsing
     * @return Success of operation
     */
    function endorseAsset(bytes32 assetId, bytes32 endorserId)
        public
        onlyOwnerOrDelegate(endorserId)
        assetExists(assetId)
        returns(bool)
    {
        LogAssetEndorsed(assetId, endorserId, msg.sender);
        return assetEndorsements[assetId].addElement(endorserId);
    }

    /**
     * Revoke endorsement of given entity by another entity
     * @param  entityId Entity id that is getting its endorsement revoked
     * @param  endorserId Entity id that is revoking its endoresement
     * @return Success of operation
     */
    function revokeEntityEndorsement(bytes32 entityId, bytes32 endorserId)
        public
        onlyOwnerOrDelegate(endorserId)
        entityExists(entityId)
        returns(bool)
    {
        LogEntityRevokeEndorsement(entityId, endorserId, msg.sender);
        return entityEndorsements[entityId].removeElement(endorserId);
    }

    /**
     * Revoke endorsement of given asset by entity
     * @param  assetId Asset id that is getting its endorsement revoked
     * @param  endorserId Entity id that is revoking its endoresement for asset
     * @return Success of operation
     */
    function revokeAssetEndorsement(bytes32 assetId, bytes32 endorserId)
        public
        onlyOwnerOrDelegate(endorserId)
        assetExists(assetId)
        returns(bool)
    {
        LogAssetRevokeEndorsement(assetId, endorserId, msg.sender);
        return assetEndorsements[assetId].removeElement(endorserId);
    }

    /**
     * Returns count of all endorsements for given entity
     * @param  entityId Entity id for which to calculate endorsements
     * @return Number of endorsements
     */
    function getEntityEndorsementCount(bytes32 entityId)
        public
        view
        returns(uint256)
    {
        return entityEndorsements[entityId].size;
    }

    /**
     * Get first (end of FIFO queue) endorsement for an entity
     * @param  entityId Entity id for which to get endorsement
     * @return First entity on the list
     */
    function getFirstEntityEndorsement(bytes32 entityId)
        public
        view
        returns(bytes32)
    {
        return entityEndorsements[entityId].tail;
    }

    /**
     * Returns next endorser in list.
     * @param  entityId Entity id of endorsed entity
     * @param  endorserId Entity id of current endorser in the loop
     * @return Next endorser in the list
     */
    function getNextEntityEndorsement(bytes32 entityId, bytes32 endorserId)
        public
        view
        returns(bytes32)
    {
        return entityEndorsements[entityId].getNext(endorserId);
    }

    /**
     * Returns whether or not entity is endorsed by given entity
     * @param  entityId Entity to endorse
     * @param  endorserId Entity that should endorse
     * @return True if is endorsed, false otherwise
     */
    function isEntityEndorsed(bytes32 entityId, bytes32 endorserId)
        public
        view
        returns(bool)
    {
        return entityEndorsements[entityId].getElement(endorserId);
    }

    /**
     * Returns count of all endorsements for given asset
     * @param  assetId Asset id for which to calculate endorsements
     * @return Number of endorsements
     */
    function getAssetEndorsementCount(bytes32 assetId)
        public
        view
        returns(uint256)
    {
        return assetEndorsements[assetId].size;
    }

    /**
     * Get first (end of FIFO queue) endorsement for an asset
     * @param  assetId Asset id for which to get endorsement
     * @return First assset id on the list
     */
    function getFirstAssetEndorsement(bytes32 assetId)
        public
        view
        returns(bytes32)
    {
        return assetEndorsements[assetId].tail;
    }

    /**
     * Returns next endorser in list.
     * @param  assetId Asset id of endorsed asset
     * @param  endorserId Entity id of current endorser in the loop
     * @return Next endorser in the list
     */
    function getNextAssetEndorsement(bytes32 assetId, bytes32 endorserId)
        public
        view
        returns(bytes32)
    {
        return assetEndorsements[assetId].getNext(endorserId);
    }

    /**
     * Returns whether or not asset is endorsed by given entity
     * @param  assetId Asset to endorse
     * @param  endorserId Entity that should endorse
     * @return True if is endorsed, false otherwise
     */
    function isAssetEndorsed(bytes32 assetId, bytes32 endorserId)
        public
        view
        returns(bool)
    {
        return assetEndorsements[assetId].getElement(endorserId);
    }
}
